import React from 'react';
import TopPage from '../components/TopPage';
import Footer from '../components/Footer';
import '../App.css';

function About() {
  return (
    <>
      <TopPage />
      <main style={{
          padding: '50px 20px', 
          color: '#fff', 
          minHeight: '80vh', 
          backgroundColor: '#121212'
        }}>
        <h2>About Me</h2>
        <p>
          Welcome! I am Pranav Chahal, a passionate 3D artist with a flair for digital innovation. Here, you can learn about my background,
          achievements, and the journey that led me to create stunning digital art. (More details and achievements coming soon...)
        </p>
        {/* Customize this page with your own sections and achievements */}
      </main>
      <Footer />
    </>
  );
}

export default About;
